                                <h3 class="font-size-20 travelport-developers-align lg-sm-text-center">حلول إدارة علاقات العملاء (CRM)</h3>
                                <p class="text-justify">يقوم مهندسو البرمجيات ومطوروها لدينا بإنشاء حلول إدارة علاقات العملاء المخصصة التي تناسب أهداف العمل بشكل أفضل، و تثبيت وعملية نقل الأنظمة الأساسية الرائدة في الصناعة، مثل Salesforce و SugarCRM و Microsoft Dynamics و SAP والمزيد لتحقيق تكامل سلس لإدارة علاقات العملاء. </p>
